import './App.css';
import Nav from './components/Nav';
import {Cards} from './components/Cards';
import { Routes, Route } from 'react-router-dom';
const [reg,setReg]=useState({status:'card'})
import {Reg} from './Reg';

function App() {
  return (
    <>
     <Nav/> 
     {
     Reg=="card"?<Cards setReg/>:<Reg/>
     }
    </>
  );
}

export default App;
